import React, { useState, useEffect } from 'react'
import { Container, Nav, Navbar, NavDropdown } from 'react-bootstrap'
import StaticSunBurst from '../buildCharts/sunBurstChart/StaticSunBurst'
import BoxPlot from '../charts/BoxPlot'
import StaticBoxPlot from '../buildCharts/boxPlotChart/StaticBoxPlot'
import WordCloud from '../charts/WordCloud'
import StaticWordCloud from '../buildCharts/wordCloudChart/StaticWordCloud'
import StaticStackedBar from '../buildCharts/stackedBarChart/StaticStackedBar'
import StaticTimeLine from '../buildCharts/timeLineChart/StaticTimeLine'

const ChooseCharts = ({ title, showChart, showTimeline, initialChart }) => {
  const [activeChart, setActiveChart] = useState(initialChart)
  const [chartData, setChartData] = useState({
    boxPlotData: {},
    wordCloudData: {},
    timeLineData: {},
    sunburstData: {},
    sunburstLabel: {},
    eventTypeColor: {},
  })

  useEffect(() => {
    if (initialChart === 'SunBurst') {
      // Carregar dados iniciais para SunBurst, se necessário
    }
  }, [initialChart])

  const handleDataReceived = (data, key) => {
    setChartData((prevState) => ({
      ...prevState,
      [key]: data,
    }))
  }

  const renderActiveChart = () => {
    switch (activeChart) {
      case 'SunBurst':
        return chartData.sunburstLabel ? (
          <StaticSunBurst
            timeLabel={chartData.sunburstLabel}
            data={chartData.sunburstData}
            onDataReceived={(data) => handleDataReceived(data, 'boxPlotData')}
            onWordDataReceived={(data) =>
              handleDataReceived(data, 'wordCloudData')
            }
            onTimeLineDataReceived={(data) =>
              handleDataReceived(data, 'timeLineData')
            }
            onEventTypeColor={(data) =>
              handleDataReceived(data, 'eventTypeColor')
            }
          />
        ) : (
          <StaticSunBurst
            onDataReceived={(data) => handleDataReceived(data, 'boxPlotData')}
            onWordDataReceived={(data) =>
              handleDataReceived(data, 'wordCloudData')
            }
            onTimeLineDataReceived={(data) =>
              handleDataReceived(data, 'timeLineData')
            }
            onEventTypeColor={(data) =>
              handleDataReceived(data, 'eventTypeColor')
            }
          />
        )
      case 'BoxPlot':
        return chartData.boxPlotData &&
          Object.keys(chartData.boxPlotData).length > 0 ? (
          <BoxPlot data={chartData.boxPlotData} />
        ) : (
          <StaticBoxPlot />
        )
      case 'WordCloud':
        return chartData.wordCloudData && chartData.wordCloudData.length > 0 ? (
          <WordCloud data={chartData.wordCloudData} />
        ) : (
          <StaticWordCloud />
        )
      case 'StackedBarChart':
        return <StaticStackedBar />
      case 'TimeLineChar':
        return chartData.timeLineData && chartData.timeLineData.length > 0 ? (
          <StaticTimeLine
            data={chartData.timeLineData}
            onDataReceived={(data) => handleDataReceived(data, 'boxPlotData')}
            onWordDataReceived={(data) =>
              handleDataReceived(data, 'wordCloudData')
            }
            onExpLabelReceived={(data) =>
              handleDataReceived(data, 'sunburstLabel')
            }
            onExpDataReceived={(data) =>
              handleDataReceived(data, 'sunburstData')
            }
            onEventTypeColor={chartData.eventTypeColor}
          />
        ) : (
          <StaticTimeLine
            onEventTypeColor={chartData.eventTypeColor}
            onDataReceived={(data) => handleDataReceived(data, 'boxPlotData')}
            onExpLabelReceived={(data) =>
              handleDataReceived(data, 'sunburstLabel')
            }
            onExpDataReceived={(data) =>
              handleDataReceived(data, 'sunburstData')
            }
            onWordDataReceived={(data) =>
              handleDataReceived(data, 'wordCloudData')
            }
          />
        )
      default:
        return null
    }
  }

  return (
    <div>
      <Navbar expand="lg" className={'custom-navbar'}>
        <Container fluid>
          <Navbar.Brand href="#home">{title}</Navbar.Brand>
          <Navbar.Toggle aria-controls="navbar-dark-example" />
          <Navbar.Collapse id="navbar-dark-example">
            <Nav className="ms-auto">
              <NavDropdown
                id="nav-dropdown-dark-example"
                title="Choose a Chart"
                onSelect={(eventKey) => setActiveChart(eventKey)}
              >
                {showChart && (
                  <>
                    <NavDropdown.Item eventKey="SunBurst">
                      SunBurst
                    </NavDropdown.Item>
                    <NavDropdown.Item eventKey="BoxPlot">
                      BoxPlot
                    </NavDropdown.Item>
                    <NavDropdown.Item eventKey="WordCloud">
                      WordCloud
                    </NavDropdown.Item>
                    <NavDropdown.Item eventKey="StackedBarChart">
                      StackedBarChart
                    </NavDropdown.Item>
                  </>
                )}
                {showTimeline && (
                  <NavDropdown.Item eventKey="TimeLineChar">
                    TimeLine
                  </NavDropdown.Item>
                )}
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <div className="chart-container">{renderActiveChart()}</div>
    </div>
  )
}

export default ChooseCharts
